[workspace]
resolver = "2"
members = [
    "ports/servoshell",
    "tests/unit/*",
]
default-members = ["ports/servoshell"]
exclude = [".cargo", "support/crown"]

[workspace.package]
version = "0.0.1"
authors = ["The Servo Project Developers"]
license = "MPL-2.0"
edition = "2021"
publish = false
rust-version = "1.83.0"

[workspace.dependencies]
accountable-refcell = "0.2.0"
aes = "0.8.4"
aes-kw = { version = "0.2.1", features = ["alloc"] }
